  realm: 'bassure',
  clientId: 'ats-oidc',
  onLoad: 'login-required',
  KeycloakResponseType: 'code'
}
export var keycloak = Keycloak(initOptions);


function App() {
  return (
    <div className="App">

    </div>
  );
}

export default App;
